  true,\n\t\"url\": null,\n\t\"notes\": \"As part of its mandate under Title VII of
  the Civil Rights Act of 1964, as amended, the Equal Employment Opportunity Commission
  requires periodic reports from public and private employers, and unions and labor
  organizations which indicate the composition of their work forces by sex and by
  race/ethnic category. Key among these reports is the EEO-1, which is collected annually
  from Private employers with 100 or more employees or federal contractors with 50
  more employees. In 2007, over 67,800 employers with more than 61.3 million employees
  filed EEO-1 reports. The confidentiality provision which governs release of these
  data (Section 709 (e) of Title VII of the Civil Rights Act of 1964, as amended by
  the Equal Employment Opportunity Act of 1972) prohibits release of individually
  identifiable information. However, data in aggregated format for major geographic
  areas and by industry group for private employers (EEO-1) are available. The following
  tables are national aggregations by those industries with the greatest employment.\",\n\t\"license_title\":
